# ## 5.2 Outlier detection and removal

# MARKDOWN ********************

# We have a significant problems with outliers in both data sets:
# 
# * most of the distributions are not normal;
# 
# * huge outliers;
# 
# * higly right-skeved data in Avocado Prices data set;
# 
# * a lot of outliers.
# 
# Tukeyâ€™s (1977) technique is used to detect outliers in skewed or non bell-shaped data since it makes no distributional assumptions. However, Tukeyâ€™s method may not be appropriate for a small sample size. The general rule is that anything not in the range of (Q1 - 1.5 IQR) and (Q3 + 1.5 IQR) is an outlier, and can be removed.
# 
# Inter Quartile Range (IQR) is one of the most extensively used procedure for outlier detection and removal.
# 
# There are other methods for detecting the outliers for example by using Standard deviation method or Z-score method. Here we use Tukey's IQR method method 
# 
# Procedure:
# 
# 1. Find the first quartile, Q1.
# 2. Find the third quartile, Q3.
# 3. Calculate the IQR. IQR = Q3-Q1.
# 4. Define the normal data range with lower limit as Q1â€“1.5 IQR and upper limit as Q3+1.5 IQR.


# MARKDOWN ********************

# ![OUTLI.png](attachment:d478134c-190a-4cfa-af7f-deabcf84195a.png)

# ATTACHMENTS ********************

# ATTA {
# ATTA   "d478134c-190a-4cfa-af7f-deabcf84195a.png": {
# ATTA     "image/png": ""
# ATTA   }
# ATTA }

# CELL ********************

def IQR_method (df,n,features):
    """
    Takes a dataframe and returns an index list corresponding to the observations 
    containing more than n outliers according to the Tukey IQR method.
    """
    outlier_list = []
    
    for column in features:
                
        # 1st quartile (25%)
        Q1 = np.percentile(df[column], 25)
        # 3rd quartile (75%)
        Q3 = np.percentile(df[column],75)
        
        # Interquartile range (IQR)
        IQR = Q3 - Q1
        
        # outlier step
        outlier_step = 1.5 * IQR
        
        # Determining a list of indices of outliers
        outlier_list_column = df[(df[column] < Q1 - outlier_step) | (df[column] > Q3 + outlier_step )].index
        
        # appending the list of outliers 
        outlier_list.extend(outlier_list_column)
        
    # selecting observations containing more than x outliers
    outlier_list = Counter(outlier_list)        
    multiple_outliers = list( k for k, v in outlier_list.items() if v > n )
    
    # Calculate the number of records below and above lower and above bound value respectively
    df1 = df[df[column] < Q1 - outlier_step]
    df2 = df[df[column] > Q3 + outlier_step]
    
    print('Total number of deleted outliers:', df1.shape[0]+df2.shape[0])
    
    return multiple_outliers

